(function() {
    /* global angular, html2canvas, pdfMake, Blob, saveAs */
    
    narocilaPotrdilIzpitovCtrl.$inject = ['studentPodatki', '$scope', '$location', 'authentication', 'ostaloPodatki', '$window'];
    
    
    function narocilaPotrdilIzpitovCtrl(studentPodatki, $scope, $location, authentication, ostaloPodatki, $window){
        var vm = this;
        
        vm.RNarocilaOpravljenihIzpitov = true;
        
         vm.vpisan=authentication.currentUser();
         console.log("Vpisan: ", vm.vpisan);
        
        if(authentication.currentUser().zaposlen){
            ostaloPodatki.najdiZaposlenega(authentication.currentUser().zaposlen).then(
                function success(odgovor){
                    vm.ime = odgovor.data.zaposlen.ime;
                    vm.priimek = odgovor.data.zaposlen.priimek;
                },
                function error(odgovor){
                    console.log(odgovor);
                }
            );
        }
        
        vm.logoutFunc = function() {
            delTok();
            return $location.path('/login');
        };
        function delTok(){
            return authentication.logout();
        }
        
        vm.naStran = 10.0;
        vm.stran = 0;
        vm.strani = [1];
        vm.nextPage = function(){
            if(vm.stran < vm.strani.length -1){
                vm.stran++;
            }
        };
        vm.prevPage = function(){
            if(vm.stran > 0){
                vm.stran--;
            }
        };
        vm.setPage = function(x){
            vm.stran = x - 1;
            
            if(vm.stran < 0)
                vm.stran = 0;
            else if(vm.stran > vm.strani.length)
                vm.stran = vm.strani.length;
        };
        function pripraviStrani() {
            setTimeout(function() {
                vm.strani = [1];
                if($scope.query)
                {
                    var max = Math.ceil($scope.query.length / vm.naStran);
                    console.log($scope.query.length + " - " + max);
                    for(var i = 1; i < max; i++) {
                        vm.strani.push(i + 1);
                    }
                    
                    vm.setPage(0);
                }
                
                vm.n = vm.strani.length-1;
                $scope.$apply();
            }, 500);
        }
        $scope.$watch('iskanje', function() {
            pripraviStrani();
        });
        
        vm.prikaziStudente = function(){
            ostaloPodatki.pridobiVsaNarocilaIzpitov().then(
                function success(odgovor){
                    console.log("Prvi odgovor: ", odgovor.data);
                    vm.studenti = odgovor.data;
                    vm.temp = [];
                    vm.kolicina = 1;
                    if(vm.vpisan.student)
                    {
                      for (var i = 0; i < vm.studenti.length; i++) {
                        if(vm.studenti[i].student._id == vm.vpisan.student)
                        {
                          vm.temp.push(vm.studenti[i]);
                        }
                      }
                      vm.studenti = vm.temp;
                    }
                    console.log("Odgovor filter:", vm.studenti);
                    
                    studentPodatki.izpisStudenta(vm.vpisan.student).then(
                      function success(odgovor){
                        vm.studentObject = odgovor.data;
                        console.log("Student object: ", vm.studentObject);
                        vm.studijskoLeto = vm.studentObject.studijska_leta_studenta[0].studijsko_leto;
                        pripraviStrani();
                      },
                      function error(odgovor){
                        console.log(odgovor);
                      }
                    );
                    
                },
                function error(odgovor){
                    console.log(odgovor);
                }
            );
        };
        
        vm.narociPotrdilo = function()
        {
          var data = {
              izvodov: vm.kolicina
          };
          console.log("Data: ", data);
          ostaloPodatki.narociPotrdiloIzpitov(data).then(
                function success(odgovor){
                    vm.obvestilo = "";
                    vm.prikaziStudente();
                },
                function error(odgovor){
                    vm.obvestilo = odgovor.data.message;
                }
            );
        };
        
        vm.izpisPotrdila = function(vpisId)
        {
            console.log("id:", vpisId);
            $window.open("/api/v1/potrdilo-izpitov/" + vpisId, "_blank")
        };
        
        vm.potrdiNarocilo = function(narociloId)
        {
            ostaloPodatki.zakljuciNarociloPotrdilaIzpitov(narociloId).then(
                function success(odgovor){
                    vm.prikaziStudente();
                },
                function error(odgovor){
                    console.log(odgovor);
                }
            );
        };
               
       $scope.orderByMe = function(x) {
            if($scope.myOrderBy == x){
                $scope.bool=!($scope.bool);
            }
            
            $scope.myOrderBy = x;
        };

        function buildTableBody(data, columns, names) {
            var body = [];
            var i=1;
            body.push(names);
           
        
            data.forEach(function(row) {
                var dataRow = [];
                
                dataRow.push(i.toString());
                i++;
                columns.forEach(function(column) {
                  
                    dataRow.push(row[column].toString());
                })
                
                body.push(dataRow);
            });
        
            return body;
        }
        
        function table(data, columns, names) {
            return {
                table: {
                    margin:150,
                    headerRows: 1,
                    body: buildTableBody(data, columns, names),
                    alignment: 'center'
                },
                layout: 'lightHorizontalLines'
            };
        }

        vm.exportDataPDF= function(){
           var today = new Date();
            var dy = today.getDate();
            var mm = today.getMonth()+1; //January is 0!
            var yyyy = today.getFullYear();
            if(dy<10) {
                dy = '0'+dy;
            } 
            
            if(mm<10) {
                mm = '0'+mm;
            } 
            
            today =  "Datum: " + dy + '/' + mm + '/' + yyyy;
            
            var docDefinition = {
                header: {
                    margin: 30,
                    columns: [
                        {
                            // usually you would use a dataUri instead of the name for client-side printing
                            // sampleImage.jpg however works inside playground so you can play with it
                            image: "data:image/png;base64,",
                            width: 150
                        },
                        { text: 'Študenti',  margin: [50,70], fontSize: 16, alignment: 'center' },
                        {
                            margin: [0,50],
                            text: today,
                            alignment: 'center'
                        }
                    ]
                },
                footer: function(currentPage, pageCount) {
                    return {
                        margin:10,
                        columns: [
                        {
                            fontSize: 9,
                            text:[
                            {
                            text: '--------------------------------------------------------------------------' +
                            '\n',
                            margin: [0, 20]
                            },
                            {
                            text: currentPage.toString() + ' of ' + pageCount,
                            }
                            ],
                            alignment: 'center'
                        }
                        ]
                    };
              
                },
                
               	content: [
                   
                    table($scope.query,
                        ['vpisna_stevilka', 'priimek', 'ime'],
                        ['#','Vpisna št.',      'Priimek', 'Ime'])
                        
                ],
                pageMargins: [30,120,50,50]
                
                
        
             };
             pdfMake.createPdf(docDefinition).download('optionalName.pdf');
        }

        vm.sklepi = function(studentId)
        {
            $location.path("/sklepi/" + studentId);
        };
        
        vm.izpiti = function(studentId)
        {
            $location.path("/izpitiForce/" + studentId);  
        };

        vm.uredi = function(studentID){
            $location.path("/podrobnostiStudenta/" + studentID);
        };
       
       vm.zetoni = function(studentId)
       {
            console.log("prikaziStudente/" + studentId + "/zetoni");
            $location.path("prikaziStudente/" + studentId + "/zetoni");  
       };
       vm.refer = function(studentId)
       {
            
            $location.path("kartotecniList/" + studentId);  
       };
        
    }
    
    angular
        .module('tpo')
        .controller('narocilaPotrdilIzpitovCtrl', narocilaPotrdilIzpitovCtrl);
})();